INSERT INTO `sub_materis` (`id`, `materi_id`, `judul`, `gambar`, `content`, `created_at`, `updated_at`) VALUES
(1, 1, 'SEPAK BOLA (FOOTBALL)', 'materi1_1.jpg', '<h1>A. Sepakbola</h1><h1>1. Sejarah Sepak Bola</h1><p>Sepak bola telah dikenal keberadaannya sejak abad kedua Sebelum Masehi oleh bangsa Tiongkok. Permainan ini dikenal dengan sebutan Tsu-Chiu, di mana pemainnya harus menggiring bola yang terbuat dari kulit ke dalam jaring kecil milik lawan. Permainan sepak bola semakin berkembang hingga ke Italia pada abad ke-16. Selama tahun 1800-an, permainan sepak bola terus berkembang ke seluruh dunia. Hingga pada akhirnya, terbentuklah asosiasi tertinggi sepak bola dunia, yaitu The Fédération Internationale de Football Association (FIFA), pada awal tahun 1900-an. Dengan adanya FIFA, kompetisi permainan sepak bola dapat dilakukan di berbagai negara.</p><h1>2. Peraturan Sepak Bola</h1><p><strong style=\"color: black;\">A. Lapangan Permainan</strong>Lapangan sepak bola sesuai standar yang digunakan berbentuk empat persegi panjang, dengan garis samping (touch line) harus lebih panjang dari garis gawang (goal line). Panjang lapangan minimal 90 m dan maksimal 120 m serta lebar lapangan minimal 45 m dan maksimal 90 m. Sementara itu, ukuran lapangan sepak bola dalam pertandingan internasional memiliki panjang minimal 100 m dan maksimal 110 m, dengan lebar minimal 64 m dan maksimal 75 m. Pada setiap ujung sisi lapangan, diberikan tanda tongkat bendera yang digunakan pemain pada saat melakukan tendangan penjuru atau sepak pojok.</p><p>Gambar 1.2</p><p><br></p><p><strong style=\"color: black;\">B. Jumlah Pemain</strong></p><p>Pemain sepak bola dalam setiap tim dibagi menjadi dua, dengan setiap tim terdiri atas 11 pemain, yang biasa disebut starting Sepak bola dimainkan oleh dua tim yang saling bertanding</p><p><img src=\"data:image/jpeg;base64,\"></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Gambar 1.2</li></ol><p><strong style=\"color: black;\">C. Gawang</strong>Tinggi gawang permainan sepak bola adalah 2,44 m, diukur dari tanah sampai sisi bawah palang gawang. Sementara itu, lebar gawang adalah 7,32 m, diukur dari sisi dalam kedua tiang gawang. Tiang palang gawang dicat putih dan dibuat dari kayu atau logam dengan ketebalan maksimal 12 cm </p><p><img src=\"data:image/jpeg;base64,\"></p><p>Gambar 1.2</p><p><br></p><p><strong style=\"color: black;\">D. Waktu Permainan</strong></p><p>Waktu pertandingan sepak bola adalah 2 x 45 menit yang terbagi dalam dua babak. Tiap babak diselingi dengan waktu istirahat selama 1b menit. Jika dalam 2 x 45 menit belum ada tim yang memperoleh kemenangan, biasanya wasit yang memimpin pertandingan akan memberikan waktu tambahan atau yang biasa disebut injury time. Lamanya waktu tambahan ini adalah 2 x 15 menit. Jika waktu tambahan sudah habis dan pertandingan masih sama kuat atau belum ada kemenangan dari salah satu tim, pertandingan akan dilanjutkan dengan adu penalti untuk menentukan tim mana yang menang. </p><p><br></p><p>Gambar 1.3</p><p><br></p><p><strong style=\"color: black;\">E. Bola</strong>Ciri kualitas dan ukuran bola sepak yang baik untuk digunakan adalah sebagai berikut.</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Berbentuk bundar/bulat.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Terbuat dari kulit atau bahan lain yang sesuai.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Diameter lingkaran tidak lebih dari 70 cm dan tidak kurang dari 68 cm.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Berat tidak lebih dari 450 g dan tidak kurang dari 410 g.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Tekanan udara dengan 0,6-1,1 atm (600-1100 g/cm).</li></ol><p>Gambar 1.4</p><p><br></p><p><strong style=\"color: black;\">F. Perlengkapan Sepakbola</strong>Perlengkapan dasar/utama yang wajib dipakai oleh seorang pemain sepak bola adalah sebagai berikut.</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Kaus olahraga.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Celana pendek, jika memakai celana penghangat warnanya harus sama dengan warna celana pendek utama.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Kaus kaki dan Pelindung tulang kering (shin guards).</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Sepatu bola.</li></ol><p>Gambar 1.5</p><p><br></p>', '2024-08-28 11:23:05', '2024-08-28 13:52:55');
